import React from 'react'
import StateParkDetails from './StateParkDetails'
import '../styles/StateParks.css'

function StateParks({ stateParksList, showStateParks, setShowStateParks }) {
  console.log(stateParksList)

  function closeParkDetails() {
    setShowStateParks(!showStateParks)
  }

  const mappedStateParksList = stateParksList.map((park) => {
    return (
      <div>
        key={park.data.id}
        name={park.data.fullName}
        url={park.data.url}
        </div>)
  })

  return (
    <div className='modal'>
      <div className='modal-content'>
        <button onClick={closeParkDetails}>Close Details</button>

      </div>
    </div>
  )
}

export default StateParks
